import React from 'react';
import './assets-css/global.css'
import './App.css'
import {Helmet} from 'react-helmet'

function App() {
  return (
    <div className="App">
      <Helmet>
      <title>My Title</title>
      </Helmet>
      <header className="App-header">
        <h1>lest's go dude</h1>
      </header>
    </div>
  );
}

export default App;
